import React from 'react';
import ReactDom from 'react-dom';
import dark from './images/dark_poster.jpg';
import strangerThings from './images/strangerThings_poster.jpg';
import breakingBad from './images/breakingBad_poster.jpg';
import Card from './Cards';
import Sdata from './Sdata';
ReactDom.render(
    <>
        <h1> List of top 5 Netflix Series in 2020 </h1>
        console.log(Sdata[0].imgsrc)
        <Card imgsrc = {Sdata[0].imgsrc}
        title = {Sdata[0].title}
        sname = {Sdata[0].sname}
        link = {Sdata[0].link}
        />
        <Card imgsrc = {strangerThings}
        title = " A Netflix Original Series "
        sname = "STRANGER THINGS"
        link = "https://www.netflix.com/in/title/80057281"
        />
        <Card imgsrc = {breakingBad}
        title = " A Netflix Original Series "
        sname = "BREAKING BAD"
        link = "https://www.netflix.com/in/title/70143836"
        />
    </>,
    document.getElementById("root")
);
